import React, { useState } from "react";
import "./ContactPage.css";

export default function Contact() {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://localhost:5000/api/contact", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });
      if (res.ok) {
        alert("Message sent successfully!");
        setFormData({ name: "", email: "", message: "" });
        setShowForm(false);
      } else {
        alert("Failed to send message.");
      }
    } catch (err) {
      console.error(err);
      alert("Error sending message.");
    }
  };

  return (
    <div className="contact-container">
      <h1 className="contact-title">Contact Me</h1>

      <div className="contact-cards">
        {/* Get in Touch */}
        <div className="contact-card">
          <div className="icon-box">‚úèÔ∏è</div>
          <h2>Get in Touch</h2>
          <p>Fill out the form with your name, email, and message to connect!</p>
          <button
            className="contact-link"
            onClick={() => setShowForm(!showForm)}
          >
            {showForm ? "Hide contact form" : "Show contact form"}
          </button>
        </div>

        {/* Direct Contact */}
        <div className="contact-card">
          <div className="icon-box">üë§</div>
          <h2>Direct Contact</h2>
          <p>
            <strong>Email:</strong>{" "}
            <a href="mailto:vedikavakhare@gmail.com" className="social-link">
              vedikavakhare@gmail.com
            </a>
          </p>color: #424656;
          <p>
            <strong>Phone:</strong>{" "}
            <a href="tel:+911234567890" className="social-link">
              +91 1234567890
            </a>
          </p>
        </div>

        {/* Follow Me */}
        <div className="contact-card">
          <div className="icon-box">üîó</div>
          <h2>Follow Me</h2>
          <ul>
            <li><a href="#" className="social-link">LinkedIn</a></li>
            <li><a href="#" className="social-link">Twitter</a></li>
            <li><a href="#" className="social-link">GitHub</a></li>
          </ul>
        </div>
      </div>

      {showForm && (
        <form className="contact-form" onSubmit={handleSubmit}>
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={formData.name}
            onChange={handleChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Your Email"
            value={formData.email}
            onChange={handleChange}
            required
          />
          <textarea
            name="message"
            placeholder="Your Message"
            rows="5"
            value={formData.message}
            onChange={handleChange}
            required
          />
          <button type="submit">Send Message</button>
        </form>
      )}
    </div>
  );
}
